(11, 'remind_of_new_order', 0, 'Êñ∞ËÆ¢ÂçïÈÄöÁü•', '‰∫≤Áà±ÁöÑÂ∫óÈïøÔºåÊÇ®Â•ΩÔºö\r\n   Âø´Êù•ÁúãÁúãÂêßÔºåÂèàÊúâÊñ∞ËÆ¢Âçï‰∫Ü„ÄÇ\r\n    ËÆ¢ÂçïÂè∑:{$order.order_sn} \r\n ËÆ¢ÂçïÈáëÈ¢ù:{$order.order_amount}Ôºå\r\n Áî®Êà∑Ë¥≠‰π∞ÂïÜÂìÅ:{foreach from=$goods_list item=goods_data}{$goods_data.goods_name}(Ë¥ßÂè∑:{$goods_data.goods_sn})    {/foreach} \r\n\r\n Êî∂Ë¥ß‰∫∫:{$order.consignee}Ôºå \r\n Êî∂Ë¥ß‰∫∫Âú∞ÂùÄ:{$order.address}Ôºå\r\n Êî∂Ë¥ß‰∫∫ÁîµËØù:{$order.tel} {$order.mobile}, \r\n ÈÖçÈÄÅÊñπÂºè:{$order.shipping_name}(Ë¥πÁî®:{$order.shipping_fee}), \r\n{if $order.pay_id eq 1}\r\n ‰ªòÊ¨æÊñπÂºè:{$order.pay_name}(Ë¥πÁî®:{$order.surplus})„ÄÇ\r\n{else}\r\n ‰ªòÊ¨æÊñπÂºè:{$order.pay_name}(Ë¥πÁî®:{$order.pay_fee})„ÄÇ\r\n{/if}\r\n\r\n               Á≥ªÁªüÊèêÈÜí\r\n               {$send_date}', 1433268639, 0, 'template'),
